import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginPageComponent } from './login-page/login-page.component';
import { AdminHeaderComponent } from './admin-header/admin-header.component';
import { AdminComponent } from './admin/admin.component';
import { AdminLeftNavComponent } from './admin-left-nav/admin-left-nav.component';
import { AddNewDoctorComponent } from './add-new-doctor/add-new-doctor.component';
import { AddNewPatientComponent } from './add-new-patient/add-new-patient.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { ViewAllDoctorsComponent } from './view-all-doctors/view-all-doctors.component';
import { RemoveDoctorComponent } from './remove-doctor/remove-doctor.component';
import { UpdateDoctorComponent } from './update-doctor/update-doctor.component';
import { UpdatePatientComponent } from './update-patient/update-patient.component';
import { RemovePatientComponent } from './remove-patient/remove-patient.component';
import { ViewAllPatientsComponent } from './view-all-patients/view-all-patients.component';
import { AddNewNurseComponent } from './add-new-nurse/add-new-nurse.component';
import { UpdatenurseComponent } from './updatenurse/updatenurse.component';
import { RemoveNurseComponent } from './remove-nurse/remove-nurse.component';
import { RemoveAppointmentComponent } from './remove-appointment/remove-appointment.component';
import { UpdateAppointmentComponent } from './update-appointment/update-appointment.component';
import { ViewAllAppointmentsComponent } from './view-all-appointments/view-all-appointments.component';
import { ChangeUsernameComponent } from './change-username/change-username.component';
import { ChangePasswordComponent } from './change-password/change-password.component';
import { MyProfileComponent } from './my-profile/my-profile.component';
import { ViewAllNursesComponent } from './view-all-nurses/view-all-nurses.component';
import { PatientHeaderComponent } from './patient-header/patient-header.component';
import { PatientComponent } from './patient/patient.component';
import { PatientLeftNavComponent } from './patient-left-nav/patient-left-nav.component';
import { PatientDashboardComponent } from './patient-dashboard/patient-dashboard.component';
import { BookAppointmentComponent } from './book-appointment/book-appointment.component';
import { ViewAppointmentComponent } from './view-appointment/view-appointment.component';

const routes: Routes = [
  {
    path: '',redirectTo:'login',pathMatch:'full'
  },
  {
    path:'login',
    component:LoginPageComponent
  },
  {
    path:'admin-header',
    component:AdminHeaderComponent
  },
  {
    path:'admin',
    component:AdminComponent,
    children:[
      {
        path:'',redirectTo:'dashboard',pathMatch:'full'
      },
      {
        path:'dashboard',
        component:DashboardComponent
      },
      {
        path:'add-new-doctor',
        component:AddNewDoctorComponent
      },
      {
        path:'add-new-patient',
        component:AddNewPatientComponent
      },
      {
        path:'edit-view-all-doctors',
        component:ViewAllDoctorsComponent
      },
      {
        path:'remove-doctor',
        component:RemoveDoctorComponent
      },
      {
        path:'update-doctor',
        component:UpdateDoctorComponent
      },
      /*{
        path:'remove-patient',
        component:RemovePatientComponent
      },*/
      {
        path:'update-patient',
        component:UpdatePatientComponent
      },
      {
        path:'edit-view-all-patient',
        component:ViewAllPatientsComponent
      },
      /*{
        path:'add-new-nurse',
        component:AddNewNurseComponent
      },
      {
        path:'update-nurse',
        component:UpdatenurseComponent
      },
      {
        path:'remove-nurse',
        component:RemoveNurseComponent
      },
      {
        path:'remove-appointments',
        component:RemoveAppointmentComponent
      },
      {
        path:'update-appointments',
        component:UpdateAppointmentComponent
      },*/
      {
        path:'view-all-appointments',
        component:ViewAllAppointmentsComponent
      },
      {
        path:'change-username',
        component:ChangeUsernameComponent
      },
      /*{
        path:'change-password',
        component:ChangePasswordComponent
      },*/
      {
        path:'my-profile',
        component:MyProfileComponent
      },
      /*{
        path:'view-all-nurses',
        component:ViewAllNursesComponent
      }*/
    ]
  },
  {
    path:'admin-left-nav',
    component:AdminLeftNavComponent
  },
  {
    path:'patient-header',
    component:PatientHeaderComponent  
  },
  {
    path:'patient',
    component:PatientComponent,
    children:[
      {
        path:'',redirectTo:'patient-dashboard',pathMatch:'full'
      },
      {
        path:'patient-dashboard',
        component:PatientDashboardComponent
      },
      {
        path:'book-appointment',
        component:BookAppointmentComponent
      },
      {
        path:'view-appointment-patient',
        component:ViewAppointmentComponent
      }
    ]
  },
  {
    path:'patient-left-nav',
    component:PatientLeftNavComponent
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
